void calc_statistic(int size, int* arr,
	int& positives,
	int& zeros,
	int& negatives
	) {
	positives = 0;
	zeros = 0;
	negatives = 0;
	for (int k = 0; k < size; k++) {
		if (arr[k] < 0)
			negatives++;
		else if (arr[k] > 0)
			positives++;
		else
			zeros++;
	}
}

