void get_sum_and_prod(
	int size,
	int* arr,
	int& sum,
	int& prod
) {
	sum = 0;
	prod = 1;

	//sum = arr[0] + arr[1] + arr[2] + ... + arr[size - 1];
	//pord = arr[0]*arr[1]* ... arr[size-2]*arr[size-1]

	for (int k = 0; k < size; k++) {
		sum += arr[k];
		prod *= arr[k];
	}
}

