	if(project == null)
		throw new ReportException("ะะต ะฒัะฑัะฐะฝ ะฟัะพะตะบั");
	if (reportType == null)
		throw new ReportException("ะขะธะฟ ะพััะตัะฐ ะฝะต ะฒัะฑัะฐะฝ");
      project = context.GetObject(project.Id);
	_data = new ReportData();
	_data.Title = "ะกะพััะฐะฒ " + (reportType  == "RD" ? "ัะฐะฑะพัะตะน" : "ะฟัะพะตะบัะฝะพะน") + " ะดะพะบัะผะตะฝัะฐัะธะธ";
	_data.Set = reportType == "RD" ? "ะบะพะผะฟะปะตะบัะฐ" : "ัะฐะทะดะตะปะฐ";
	_data.Stage = reportType == "RD" ? "ะ" : "ะ";

	var projectObj = Project.Value as RObject;
	_data.ProjectCode = GetAttributeValue<string>(projectObj , "code");
	_data.ProjectTitle = GetAttributeValue<string>(projectObj, "project_name");

	_data.Elements = CollectElements(project);
